import React, { useEffect, useState } from 'react'
import { api } from '../App'

function Form() {

  const getUsers = () => { api.get('/').then(res => setusers(res.data)).catch(err => { console.log(err) }) }

  useEffect(() => {
    getUsers()
  }, [])

  const [users, setusers] = useState([]);

  async function submithandler(e) {
    e.preventDefault()
    await api.post('/', { id: 6, first_name: 'sagar', last_name: 'chhatbar', email: 'sagar@gmail.com' }).catch(err => console.log(err))
    console.log(users)
  }



  return (
    <div>
      <form onSubmit={submithandler}>
        <input type='text' placeholder='first name' />
        <input type='text' placeholder='last name' />
        <input type='email' placeholder='email' />
        <button onClick={getUsers}>create user</button>
      </form>
    </div>
  )
}

export default Form
